import React from 'react';
import logo from './logo.svg';
import './App.css';
import Title from './Components/Title.jsx';
import {
  RecoilRoot,
  atom,
  selector,
  useRecoilState,
  useRecoilValue,
} from 'recoil';

//declare a new atom
const textState = atom({
  key: 'textState',
  default: 'initial value'
});

//use useRecoilState to read and from an atom

function App() {
  return (
    <RecoilRoot>
      <div className="App">
        <Title />
      </div>
    </RecoilRoot>
  );
}

export default App;
